import React from 'react'


export default Trucks =>{

    const [trucks,setTrucks] = React.useState(null)


    React.useEffect(()=>{
        const fetchTrucks = async () => {
            const response = await fetch('./trucks');
            const json = await response.json()

            if(response.ok){
                setTrucks(json)
            }
        }
        fetchTrucks()

    },[])

    return (
        <>
        <div>
            {trucks && trucks.map((truck) => {return(
                <div className='truck'>
                <p key={truck._id}>Unit Number: {truck.unitNumber}</p>
                <p key={truck._id}>Truck Make: {truck.unitMake}</p>
                <p key={truck._id}>Truck Model: {truck.unitModel}</p>
                </div>
             )})}
        </div>
        
        
        </>
    )
}
